impl Solution {
    pub fn count_complete_substrings(word: String, k: i32) -> i32 {
        let mut result = 0;
        let mut char_counts = [0; 26];
        let k = k as usize;
        let word_bytes = word.as_bytes();

        for start in 0..word.len() {
            char_counts.iter_mut().for_each(|x| *x = 0);
            for end in start..word.len() {
                char_counts[(word_bytes[end] - b'a') as usize] += 1;
                if char_counts.iter().filter(|&&c| c > 0).all(|&c| c == k) {
                    let max_char = char_counts.iter().enumerate().filter(|&(_, &c)| c > 0).max_by_key(|&(_, &c)| c).unwrap().0 as u8;
                    let min_char = char_counts.iter().enumerate().filter(|&(_, &c)| c > 0).min_by_key(|&(_, &c)| c).unwrap().0 as u8;
                    if max_char - min_char <= 2 {
                        result += 1;
                    }
                }
            }
        }

        result
    }
}
